import React from 'react';
import { Section, SectionAlternate } from 'components/organisms';
import { Hero, Main, Partners ,Result } from './components';

import { folio, partners,result} from './data';

const Products = () => (
  <div>
    <Hero />
    <Partners data={partners} />
    <Section>
      <Main data/>
      <Result data={result}/>
    </Section>
    <SectionAlternate>

    </SectionAlternate>
  </div>
);

export default Products;
